import React from 'react';
import Link from 'next/link';

//기능 총 8개
const Nav = () => {
    return (
        <div>
            <Link>
                <a href="/">홈 버튼</a>
            </Link>
            <Link>
                <a href="/msg">메세지 버튼</a>
            </Link>
            <Link>
                <a href="/notice">공지사항</a>
            </Link>
            <Link>
                <a href="/schedule">업무일정</a>
            </Link>
            <Link>
                <a href="meeting-reserve">회의실예약</a>
            </Link>
            {/*
            기능 2개 
            <Link>
                <a href>업무시작</a>
            </Link>
            <Link>
                <a>업무종료</a>
            </Link> 
            */}
        </div>
    );
};

export default Nav;
